Aparatur Kelurahan se-Kecamatan Bekasi Utara bersama jajaran dari berbagai Dinas hadir di Danau Duta Harapan untuk melaksanakan kegiatan K3 (Kebersihan, Keindahan, dan Ketertiban) dalam rangka World Cleanup Day 2025.

Kegiatan ini menjadi wujud nyata kepedulian bersama dalam menjaga lingkungan agar tetap bersih, indah, dan nyaman untuk masyarakat.

Turut hadir Wali Kota Bekasi yang secara langsung memonitor jalannya kegiatan, sekaligus memberikan semangat kepada para peserta untuk terus menjaga kelestarian lingkungan.

