Wali Kota Bekasi, Tri Adhianto, menghadiri kegiatan penanaman pohon dan penyebaran benih ikan di kawasan Danau Villa Indah Permai RW 036 Kelurahan Teluk Pucung. Acara ini dilaksanakan sebagai bentuk kepedulian pemerintah terhadap kelestarian lingkungan sekaligus upaya menjaga ekosistem danau agar tetap asri dan bermanfaat bagi warga sekitar.

Dalam kesempatan tersebut, hadir pula Camat Bekasi Utara, para Lurah se-Bekasi Utara, perwakilan dari Dinas Lingkungan Hidup, serta dinas-dinas terkait. Kehadiran jajaran pemerintah ini menunjukkan sinergi bersama dalam mewujudkan lingkungan yang hijau, bersih, dan berkelanjutan di wilayah Kota Bekasi.

