Sabtu, 13 September 2025, Aparatur Kelurahan Teluk Pucung bersama seluruh warga masyarakat, mulai dari RW 1 hingga RW 37, melaksanakan Giat Sabtu Bersih secara serentak di wilayah masing-masing.

Kegiatan ini menjadi wujud nyata kepedulian bersama dalam menjaga kebersihan lingkungan sekaligus mempererat kebersamaan antarwarga. Dengan semangat gotong royong, setiap sudut lingkungan ditata, dirapikan, dan dibersihkan, sehingga tercipta suasana yang lebih nyaman, sehat, serta asri untuk seluruh warga.

Melalui giat rutin ini, diharapkan tercipta lingkungan yang tidak hanya bersih secara fisik, tetapi juga menumbuhkan rasa persatuan, kebersamaan, serta kepedulian sosial di tengah masyarakat Kelurahan Teluk Pucung.

@pemkot_bekasi 
