@kec_bekasiutara

Pada hari Sabtu, 6 September 2025, Aparatur Kelurahan Teluk Pucung bersama pengurus RT dan RW melaksanakan kegiatan Sabtu Bersih sebagai bentuk kepedulian terhadap kebersihan dan kenyamanan lingkungan.

Kegiatan berfokus di halaman Kantor Kelurahan Teluk Pucung, dengan melakukan pembersihan area kantor agar tetap tertata, rapi, dan representatif sebagai pusat pelayanan masyarakat. Dan juga di Jalan Raya Lingkar Utara, yang merupakan salah satu akses utama di wilayah Kelurahan Teluk Pucung.

Melalui kegiatan ini, aparatur kelurahan dan para pengurus wilayah menunjukkan komitmen bersama dalam menjaga kebersihan lingkungan serta menumbuhkan semangat gotong royong. Harapannya, kegiatan Sabtu Bersih ini dapat memberikan manfaat nyata bagi masyarakat serta menciptakan lingkungan yang lebih bersih, sehat, dan nyaman.

