Lurah Teluk Pucung didampingi Sekretaris Kelurahan serta Kasie Pemtrantibum turut hadir memeriahkan karnaval dalam rangka memperingati HUT RI ke-80 yang digelar di RW 37.

Karnaval kali ini berlangsung meriah dengan berbagai penampilan kreatif dari masing-masing RT yang menampilkan beragam budaya Nusantara. Mulai dari pakaian adat, tarian tradisional, hingga dekorasi bertema kemerdekaan, semuanya memberikan warna dan semangat persatuan bagi warga.

Kehadiran Lurah bersama jajaran kelurahan menjadi bentuk dukungan nyata terhadap semangat kebersamaan dan kecintaan warga terhadap budaya Indonesia, sekaligus mempererat silaturahmi antarwarga di Kelurahan Teluk Pucung.

