Rabu, 23 Juli 2025

Kelurahan Teluk Pucung melaksanakan penyaluran Bantuan Pangan Beras dari Badan Pangan Nasional yang didistribusikan melalui Perum Bulog. Bantuan ini merupakan bentuk kepedulian pemerintah dalam menjaga ketahanan pangan masyarakat, khususnya bagi warga yang membutuhkan.

Sebanyak 1.548 penerima manfaat tercatat menerima bantuan tersebut, dengan masing-masing mendapatkan 20 kilogram beras. Proses penyaluran berlangsung tertib dan lancar, berlokasi di kantor kelurahan Teluk Pucung.

Pemerintah Kelurahan Teluk Pucung menyampaikan apresiasi kepada seluruh pihak yang telah mendukung kelancaran distribusi ini, serta berharap bantuan tersebut dapat meringankan beban masyarakat dan menjaga kestabilan kebutuhan pokok di tengah kondisi ekonomi yang menantang.

