Dalam rangka menindaklanjuti Surat Edaran Gubernur Jawa Barat terkait pembatasan aktivitas malam hari bagi pelajar. Lurah Teluk Pucung bersama jajaran staf kelurahan melaksanakan giat penyisiran di sejumlah titik yang kerap menjadi lokasi keramaian pada malam hari.

Kegiatan ini dilakukan sebagai bentuk upaya preventif untuk menjaga ketertiban dan keamanan lingkungan, khususnya dari aktivitas anak-anak di bawah umur yang masih berkumpul di luar rumah pada jam malam.

Salah satu titik yang disasar dalam kegiatan tersebut adalah sebuah tempat rental PlayStation di wilayah Kelurahan Teluk Pucung. Di lokasi tersebut, tim mendapati sejumlah anak-anak yang masih berada di luar rumah melebihi batas waktu yang telah ditentukan dalam surat edaran.

Lurah Teluk Pucung menegaskan bahwa kegiatan ini akan dilakukan secara rutin dan berkelanjutan sebagai bentuk dukungan terhadap kebijakan Pemerintah Provinsi Jawa Barat dalam menjaga generasi muda dari potensi aktivitas negatif pada malam hari. Para pemilik usaha juga diimbau untuk ikut berperan aktif dengan membatasi operasional usahanya sesuai aturan yang berlaku.

