Lurah Teluk Pucung, Ismail Marjuki, didampingi Kepala Seksi Permasbang menghadiri kegiatan Sosialisasi Bantuan Cultivator kepada Kelompok Tani Mandiri Kelurahan Teluk Pucung.

Kegiatan ini merupakan program dari Dinas Ketahanan Pangan, Pertanian, dan Perikanan Kota Bekasi sebagai bentuk dukungan terhadap peningkatan produktivitas pertanian di wilayah perkotaan.

Sosialisasi dilaksanakan di Sekretariat RW 18 Kelurahan Teluk Pucung dan diikuti oleh para anggota kelompok tani dengan antusias. Diharapkan bantuan cultivator ini dapat dimanfaatkan secara optimal untuk mendukung kegiatan pertanian warga dan mewujudkan ketahanan pangan di tingkat lokal.

