Selasa, 8 Juli 2025

Lurah Teluk Pucung bersama jajaran serta didampingi oleh Dinas terkait melakukan monitoring langsung ke sejumlah titik banjir di wilayah Kelurahan Teluk Pucung, pada hari ini. Pemantauan dilakukan untuk memastikan kondisi warga terdampak serta mengevaluasi kebutuhan mendesak di lapangan.

Adapun wilayah yang terdampak paling parah akibat banjir meliputi RW 001, RW 002, RW 003, dan RW 004. Genangan air di beberapa lokasi masih cukup tinggi, sehingga menjadi prioritas penanganan darurat oleh tim gabungan dari kelurahan, BPBD, serta instansi terkait lainnya.

Sebagai bentuk respon cepat, bantuan logistik mulai didistribusikan ke wilayah-wilayah terdampak. 

Pemerintah Kelurahan Teluk Pucung terus berkoordinasi dengan pihak-pihak terkait untuk percepatan penanganan, serta mengimbau warga untuk tetap waspada dan mengikuti arahan petugas di lapangan.

