Dalam rangka memperingati Hari Ulang Tahun Bhayangkara ke-79, Camat Bekasi Utara bersama para Lurah se-Kecamatan Bekasi Utara serta Wadanramil turut hadir memberikan ucapan selamat secara langsung kepada jajaran Polsek Bekasi Utara.

