Kamis, 26 Juni 2025
Dalam rangka menyambut Tahun Baru Islam 1 Muharram 1447 Hijriah, aparatur Kelurahan Teluk Pucung Kecamatan Bekasi Utara turut serta dalam kegiatan pawai akbar yang dilaksanakan oleh Pemerintah Kota Bekasi.

Pawai dimulai dari titik kumpul di Plaza Pemkot Bekasi dan berakhir di Alun-alun Kota Bekasi, tepatnya di Masjid Al Barkah. Dengan penuh semangat dan kekompakan, para peserta pawai membawa spanduk, bendera, serta simbol-simbol Islami sebagai wujud syiar dan semangat menyambut pergantian tahun hijriah.

Kegiatan ini menjadi momentum untuk mempererat tali silaturahmi antar warga serta memperkuat nilai-nilai keislaman dan kebersamaan di lingkungan masyarakat Kota Bekasi.

