Dalam upaya membentuk generasi muda yang berkarakter dan berkualitas, Gubernur Jawa Barat menerbitkan Surat Edaran Nomor 51/PA.03/DISDIK tentang Penerapan Jam Malam Bagi Peserta Didik untuk Mewujudkan Generasi Panca Waluya Jawa Barat Istimewa.

Melalui surat edaran ini, peserta didik dibatasi untuk tidak melakukan kegiatan di luar rumah pada malam hari, yaitu mulai pukul 21.00 WIB hingga 04.00 WIB. Namun, terdapat beberapa pengecualian, yakni jika peserta didik:

1. Mengikuti kegiatan sekolah atau lembaga pendidikan resmi.

2. Mengikuti kegiatan keagamaan atau sosial di lingkungan tempat tinggal dengan tua/wali. sepengetahuan orang

3. Sedang berada di luar rumah bersama orang tua/wali.

4. Dalam kondisi darurat atau bencana.

5. Dalam kondisi tertentu dengan sepengetahuan orang tua/wali.

Kebijakan ini bertujuan menciptakan generasi Panca Waluya, yaitu generasi yang Cageur (sehat), Bageur (berakhlak baik), Bener (jujur), Pinter (cerdas), dan Singer (cekatan) Jawa Barat Istimewa. sebagai wujud visi Jawa Barat Istimewa

